import React from "react";
import styled from "styled-components";
import Post from "./components/Post/Post";
import logo from './img/insta.png'


const MainContainer = styled.div`
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
`;

function Principal() {
  return (
    <>
    <MainContainer>
      <Post
        nomeUsuario={'Fine'}
        fotoUsuario={"https://ih1.redbubble.net/image.908945701.7415/poster,504x498,f8f8f8-pad,600x600,f8f8f8.jpg"}
        fotoPost={"https://gifimage.net/wp-content/uploads/2017/10/carregando-gif-animado-9.gif"}
      />
    </MainContainer>

<MainContainer>
<Post
  nomeUsuario={'Bad'}
  fotoUsuario={"https://ih1.redbubble.net/image.908945701.7415/poster,504x498,f8f8f8-pad,600x600,f8f8f8.jpg"}
  fotoPost={"https://gifimage.net/wp-content/uploads/2017/10/carregando-gif-animado-9.gif"}
/>
</MainContainer>

<MainContainer>
<Post
  nomeUsuario={'Bu'}
  fotoUsuario={"https://ih1.redbubble.net/image.908945701.7415/poster,504x498,f8f8f8-pad,600x600,f8f8f8.jpg"}
  fotoPost={"https://gifimage.net/wp-content/uploads/2017/10/carregando-gif-animado-9.gif"}
/>
</MainContainer>
</>


  );
}

export default Principal;
